class Polygon {
    constructor(heigth=2, width=3) {
        this.heigth = heigth;
        this.width = width;
    }

    get area() {
        return this.calcArea();
    }

    calcArea() {
        return this.heigth * this.width;
    }
}

export default Polygon;
